import React from 'react'
import Navbar from '../components/navbar/Navbar'
import Slider from '../components/slider/Slider'
import { SliderData } from '../components/slider/SliderData';
const Home = () => {
    return (
        
         <div>
       <Navbar/>
       <Slider slides={SliderData} />
    </div>
  );
    }

export default Home
